import React from 'react';
import { Dimensions, Alert,StyleSheet, Image, View,
         TextInput, Text, TouchableOpacity 
} from 'react-native';
import user2 from './../../assets/user2.jpeg';
import lp_logo from './../../assets/lg_logo.jpeg';

const width = Dimensions.get('screen').width;

export default function Login2(){
    return(
        <View>
            <View style={css.container}>
                <View style={css.topo1}>
                    <Text style={css.texto_top}>Login</Text>
                </View>
                <Image style={css.img1} source={lp_logo}/>
            </View>
            <Text style={css.texto_label}>Usúario</Text>
            <TextInput
                placeholder="Usúario "
                style={css.input}
            />
            <Text style={css.texto_label}>Senha</Text>
            <TextInput
                placeholder={'*********'}
                style={css.input}
            />
            <TouchableOpacity 
                onPress={() => Alert.alert('oi')} style={css.btn}>
                <Text style={css.btnText}>
                    Cadastrar
                </Text>
            </TouchableOpacity>
        </View>
    )
}
const css = StyleSheet.create({
    container: {
        display: "flex",
        alignContent: "center",
        alignItems: "center",
    },
    texto_top: {
        color: 'white',
        fontSize: 30,
        fontWeight: 'bold',
        marginTop: 5,
    },
    texto_label: {
        marginLeft: 25,
        marginBottom: -7
    },
    topo1: {
        display: 'flex',
        alignContent: 'center',
        alignItems: 'center',
        width: "100%",
        height: 50,
        backgroundColor: "#BD3804",
        marginBottom: 50
    },
    img1: {
        width: 200,
        height: 200,
        borderRadius: 100,
        marginBottom: 50
    },
    input: {
        width: '90%',
        height: 50,
        backgroundColor: '#DDD',
        borderRadius: 20,
        padding: 15,
        marginTop: 10,
        marginBottom: 10,
        marginLeft: 20,
        fontSize: 20,
        fontWeight: 'bold',
        paddingLeft: 140
      },
      btn:{
          height: 50,
