          marginLeft: 20,
          borderRadius: 20,
          backgroundColor: '#BD3804',
          marginTop: '40%',
      },
      btnText:{
        color: 'white',
        fontSize: 20,
        width: '90%',
        marginLeft: 20,
        paddingHorizontal: '32%',
        paddingVertical: '4%',
        height: 50,
        fontWeight: 'bold',
      },
})
